СК - "Семак";
ЖК - "Rayyan +"
этажность - 10;
утепление - базальтом;
материал стен - кирпич;
отделка фасада - сары таш
коммуникации полностью центральные.

Адрес: пересечении ул.Токтогула и ул. А.Суюнбаева (Карпинская). Вместе с высочайшим качеством и престижностью место- расположения ТД “1000 мелочей”, ТЦ “ЦУМ”, ТЦ “Дордой Плаза”, ТД “Бишкек Сити”, центральная Мечеть, дом гармонично сочетает в себе высокий уровень комфорта, организованную безопасность, современные инженерные сети. Завершение строительства 4 квартал 2021 года.

СТОИМОСТЬ :700$ за м2 .

